import * as React from 'react';
import Button from '@mui/material/Button';
import './AddHouse.css';

function MyApp() {
  return (
    <div>
      <Button variant="contained">Hello World</Button>
      <Button variant="contained" endIcon={<SendIcon />}>
          Add House
      </Button>
    </div>
  );
}

export default MyApp;
